import React from "react";

const Recepe=(props)=>{
   const {fet}=props;
    return(
        <>
       
        <div className="row">
         {
         
             fet.map((respe)=>{
                 return(
                 <div className="col-md-3">
                      
                   <div className="card">
                       <img src={respe.recipe.image} width="25" height="25%" className="img-fluid"/>
                       <div className="card-body">
                       <h1>{respe.recipe.label}</h1>
                      
                      
                       </div>
                   </div>
                 </div>
                 );
             })
         }



        </div>


        </>
    );
}
export default Recepe;
